INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10005, "リンド", 0.0, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 2, 2, 0.0, "2023/12/22 14:59:59", 2002, 1, "2023/09/15 15:00:00", 2, -470.0, 127702);
