INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10009, "アネモネ", 0.0, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 1, 2, 0.0, "2024/03/22 14:59:59", 2002, 1, "2023/12/15 15:00:00", 3, -470.0, 129602);
