INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10011, "ネフィ=ネラ", 0.0, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 1, 1, 0.0, "2024/03/22 14:59:59", 2002, 1, "2023/12/15 15:00:00", 3, -470.0, 129701);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10012, "ネフィ=ネラ", 0.0, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 1, 2, 6.2, "2024/03/22 14:59:59", 2002, 2, "2023/12/15 15:00:00", 3, -470.0, 129701);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10013, "カノン", 0.0, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 5, 3, 3.1, "2024/06/22 14:59:59", 2002, 1, "2024/03/15 15:00:00", 4, -470.0, 130301);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10014, "カノン", 0.0, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 2, 3, 6.15, "2024/06/22 14:59:59", 2002, 2, "2024/03/15 15:00:00", 4, -470.0, 130301);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10015, "ナーナ", 0.0, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 2, 2, 0.0, "2024/06/22 14:59:59", 2002, 1, "2024/03/15 15:00:00", 4, -470.0, 130401);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10016, "ナーナ", 0.0, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 1, 2, 3.35, "2024/06/22 14:59:59", 2002, 2, "2024/03/15 15:00:00", 4, -470.0, 130401);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10017, "ホウオウ", 0.0, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 1, 1, 0.0, "2024/09/22 14:59:59", 2002, 1, "2024/06/15 15:00:00", 5, -470.0, 130502);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10018, "ホウオウ", 0.0, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 1, 2, 3.18, "2024/09/22 14:59:59", 2002, 2, "2024/06/15 15:00:00", 5, -470.0, 130502);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10019, "ホウオウ", 0.0, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 4, 4, 0.0, "2024/09/22 14:59:59", 2002, 3, "2024/06/15 15:00:00", 5, -470.0, 130503);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10020, "ネア", 0.0, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 2, 1, 4.9, "2024/09/22 14:59:59", 2002, 1, "2024/06/15 15:00:00", 5, -470.0, 123301);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10021, "ネア", 0.0, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 2, 1, 4.8, "2024/09/22 14:59:59", 2002, 2, "2024/06/15 15:00:00", 5, -470.0, 123301);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10022, "カリザ", 0.0, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 1, 3, 4.922, "2024/12/22 14:59:59", 2002, 1, "2024/09/15 15:00:00", 6, -470.0, 133301);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10023, "カリザ", 0.0, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 5, 3, 9.638, "2024/12/22 14:59:59", 2002, 2, "2024/09/15 15:00:00", 6, -470.0, 133301);
INSERT INTO `v1_841e9a70259baf39e68dc627d3dc2ac95dc1ba270f173f741dd29a497f2898e8` VALUES (10024, "ミーア", 0.0, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 2, 1, 2.88, "2024/12/22 14:59:59", 2002, 1, "2024/09/15 15:00:00", 6, -470.0, 133401);
